import React, { useState, useEffect } from 'react';
import axios from 'axios';
import '../components/RegisterEventDetails.css';

const RegisterEventDetails = () => {
    const [formData, setFormData] = useState({
        fechaInicio: '',
        horaInicio: '',
        fechaFin: '',
        horaFin: '',
        aperturaPuertas: '',
        modalidad: '',
        nombreLugar: '',
        ciudad: 'Cochabamba',
        enlaceUbicacion: '',
    });

    useEffect(() => {
        axios.get('http://localhost:5000/api/eventos/1')  // Obtener evento por ID (ajustar ID según necesidad)
            .then(response => {
                setFormData({
                    ...formData,
                    fechaInicio: response.data.fechaInicio,
                    horaInicio: response.data.horaInicio,
                    fechaFin: response.data.fechaFin,
                    horaFin: response.data.horaFin,
                    aperturaPuertas: response.data.aperturaPuertas,
                    modalidad: response.data.modalidad,
                    nombreLugar: response.data.nombreLugar,
                    ciudad: response.data.ciudad,
                    enlaceUbicacion: response.data.enlaceUbicacion,
                });
            })
            .catch(error => {
                console.error('Error fetching event details:', error);
            });
    }, []);

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({ ...formData, [name]: value });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        console.log('Detalles del evento:', formData);
        // Aquí puedes agregar la lógica para enviar los datos al backend
    };

    return (
        <form className="register-event-details-form" onSubmit={handleSubmit}>
            <h2>Eventos Activos</h2>
            <p>Ingresa la información básica de tu evento.</p>

            <div className="fecha-section">
                <h3>Fecha</h3>
                <div className="fecha-fields">
                    <div>
                        <label>Fecha y hora de inicio del evento</label>
                        <input
                            type="date"
                            name="fechaInicio"
                            value={formData.fechaInicio}
                            onChange={handleChange}
                            required
                        />
                        <input
                            type="time"
                            name="horaInicio"
                            value={formData.horaInicio}
                            onChange={handleChange}
                            required
                        />
                    </div>
                    <div>
                        <label>Fecha y hora de fin del evento</label>
                        <input
                            type="date"
                            name="fechaFin"
                            value={formData.fechaFin}
                            onChange={handleChange}
                            required
                        />
                        <input
                            type="time"
                            name="horaFin"
                            value={formData.horaFin}
                            onChange={handleChange}
                            required
                        />
                    </div>
                </div>
            </div>

            <div className="modalidad-section">
                <h3>Modalidad</h3>
                <input
                    type="text"
                    name="modalidad"
                    value={formData.modalidad}
                    onChange={handleChange}
                    placeholder="Modalidad del evento"
                    required
                />
            </div>

            <div className="lugar-section">
                <h3>Lugar</h3>
                <input
                    type="text"
                    name="nombreLugar"
                    value={formData.nombreLugar}
                    onChange={handleChange}
                    placeholder="Nombre del lugar"
                    required
                />
                <input
                    type="text"
                    name="ciudad"
                    value={formData.ciudad}
                    onChange={handleChange}
                    placeholder="Ciudad"
                    required
                />
                <input
                    type="text"
                    name="enlaceUbicacion"
                    value={formData.enlaceUbicacion}
                    onChange={handleChange}
                    placeholder="Enlace de ubicación"
                    required
                />
            </div>

            <button type="submit">Guardar</button>
        </form>
    );
};

export default RegisterEventDetails;
